(4, 'Jutro event zuo', '2015-02-20', '<table border="0" cellpadding="1" cellspacing="1" style="width: 500px;">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">(Bonus! Bonus! Bonus! Bonus! Bonus! Bonus!)</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Na łazarskim rejonie nie jest kolorowo</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">czasem zapija się smutki i bywa czilałtowo</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Na łazarskim rejonie, bieda tutaj piszczy</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">nie ma co się martwić, musisz podnieść się ze zgliszczy</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Tutaj pierwsza miłości i rozczarowanie</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">za stracony czas i porytą banię</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Wyciągnąłem wnioski, nigdy nie ufaj kobiecie</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Zamąci ci w głowie, wok&oacute;ł palca oplecie</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Czasami bywam na Wildzie, u ziomka na kwadracie</span></td>\r\n			<td><span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Obalamy flaszki, potem leżymy na macie</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Środkowy palec wbijam w hejter&oacute;w</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Coś ci się nie podoba, lepiej tego mi nie m&oacute;w</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Trenowałem MMA i futbol amerykański</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n			<span style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;">Teraz zajmuję się boksem w klubie poznańskim</span><br style="color: rgb(102, 102, 102); font-family: Tahoma; font-size: 11.5px; line-height: 15px;" />\r\n	